import "../App.css";

function joinGame() {
    const fetchPromise = fetch("http://localhost:8080/players/createPlayer/test", {
      method: "POST",
    })
    .then(response => {
        if(!response.ok) {
            throw new Error("Could not create a new player.")
        }
    });
  
    const streamPromise = fetchPromise.then((response) => response.text());
    streamPromise.then((data) => alert(data));
  }

function Login() {
    return (
    <div id="login">
        <input type="text" id="usernameInput"></input>
        <button id="loginButton" onClick={joinGame}>Login</button>
    </div>
    );
}

export default Login;
